window.bookSummaryJSON = "<p>The complete boxed set series of the Corrigan novellas. These five thrilling stories retell the events of the Blood Destiny books from the Lord Alpha's point of view.</p> <p>Corrigan wasn't always the Lord Alpha of the Brethren. And he wasn't always in love with Mackenzie Smith, an alleged werehamster with anger management problems. But he has always been a powerful shapeshifter who faces trouble head-on, no matter what shifter politics or supernatural machinations get in his way. Now his world isn't just filled with magic and mayhem. There's also a considerable amount of fire.</p> <p>Includes the novellas Corrigan Fire, Corrigan Magic, Corrigan Rage, Corrigan Politics, and Corrigan Lust.</p>"; 
